@Override
public boolean equals(Object o) {
  DecodedTriangle other  = (DecodedTriangle) o;
  return aX == other.aX && bX == other.bX && cX == other.cX
      && aY == other.aY && bY == other.bY && cY == other.cY
      && ab == other.ab && bc == other.bc && ca == other.ca;
}

